import './components.css';
import greenBook from '../assets/images/green_book.png';
import { useNavigate } from "react-router-dom";
import book1 from "../assets/images/book1.png";
import book2 from "../assets/images/book2.png";
import book3 from "../assets/images/book3.png";
import polaroid from "../assets/images/polaroid.png";
import bottle from "../assets/images/bottle.svg";
import blank from "../assets/images/blank_object.png";

function Bookshelf() {
  const objects = [
    {
        name: "Journal 1",
        obj_type: "Journal",
        imgUrl: book1,
    },
    {
        name: "Journal 2",
        obj_type: "Journal",
        imgUrl: book2,
    },
    {
      name: "Journal 3",
      obj_type: "Journal",
      imgUrl: book3,
    },
    {
      name: "Bottle 1",
      obj_type: "Object",
      imgUrl: bottle,
  },
  {
      name: "Polaroid 1",
      obj_type: "Polaroid",
      imgUrl: polaroid,
  },
];
  // make a list of objects and function to add items
  return (
    <div className="bookshelf">
       <div className="shelfRow">
            <div className="shelf_object">
                <span>Journal 1</span>
                <img src={book1}></img>
            </div>
            <div className="shelf_object">
                <span>Journal 2</span>
                <img src={book2}></img>
            </div>
            <div className="shelf_object">
                <span>Journal 3</span>
                <img src={book3}></img>
            </div>
       </div>
       <div className="shelfRow">
          <div className="shelf_object">
            <img src={bottle}></img>
          </div>
          <div className="shelf_object">
            <img src={polaroid}></img>
          </div>
          <div className="shelf_object">
            <img src={blank}></img>
          </div>
       </div>
    </div>
  );
}

export default Bookshelf;
